const filtersDefaultState = {
  drops: [],
  selectedDrops: [],
  hierarchy1: [],
  selectedHierarchy1: [],
  hierarchy2: [],
  selectedHierarchy2: [],
  hierarchy3: [],
  selectedHierarchy3: [],
  hierarchy4: [],
  selectedHierarchy4: [],
  hierarchy5: [],
  selectedHierarchy5: [],
  hierarchy6: [],
  selectedHierarchy6: [],
  hierarchy7: [],
  selectedHierarchy7: [],
  selectedDateRange: [],
};

export default (state = filtersDefaultState, action) => {
  switch (action.type) {
    case 'SET_DROPS':
      return {
        ...state,
        drops: action.payload,
      };
    case 'SET_HIERARCHY1':
      return {
